function encabezadoPdf(doc){
    doc.rect(0,0,210,25,'F');
        doc.setFont("times","bold");
        doc.setFontSize(20);   
        doc.setTextColor("white");
        doc.text("Jeromotos 24 ", 10, 13);
        //doc.text(cfg.dato.razonsocial, 60, 13);
        doc.setFont("times","normal");
        doc.setFontSize(14); 
        doc.text("Almacen y Taller",10,19);
}


