function convertCapitalize(str){

    let arr = str.toLowerCase().split(" ");
    let newArr = [];
    let val = "";
    for (let i = 0; i < arr.length; i++) {
        newArr.push(arr[i].charAt(0).toUpperCase() + arr[i].slice(1))
    }

    return (newArr.join(" "))
}

